css:
.nuclide-vcs-log-spinner {
  margin-top: 2em;
  text-align: center;
}
.nuclide-vcs-log-scroll-container {
  height: 100%;
  overflow-y: scroll;
}
.nuclide-vcs-log-container {
  height: 100%;
  display: flex;
}
.nuclide-vcs-log-entries-container {
  overflow: scroll;
}
.nuclide-vcs-log-cell {
  font-family: Menlo, Consolas, 'DejaVu Sans Mono', monospace;
  padding: 4px;
  vertical-align: top;
  -webkit-user-select: text;
}
.nuclide-vcs-log-fixed-cell {
  white-space: nowrap;
}
.nuclide-vcs-log-header-cell {
  padding: 4px 6px;
}
.nuclide-vcs-log-date-cell {
  font-family: Menlo, Consolas, 'DejaVu Sans Mono', monospace;
  padding: 4px;
  vertical-align: top;
  -webkit-user-select: text;
  white-space: nowrap;
  color: #6494ed;
}
.nuclide-vcs-log-id-cell {
  font-family: Menlo, Consolas, 'DejaVu Sans Mono', monospace;
  padding: 4px;
  vertical-align: top;
  -webkit-user-select: text;
  white-space: nowrap;
  color: #73c990;
}
.nuclide-vcs-log-differential-cell {
  font-family: Menlo, Consolas, 'DejaVu Sans Mono', monospace;
  padding: 4px;
  vertical-align: top;
  -webkit-user-select: text;
  white-space: nowrap;
  color: #d9dbde;
  text-decoration: underline;
}
.nuclide-vcs-log-differential-cell-text {
  cursor: pointer;
}
.nuclide-vcs-log-author-cell {
  font-family: Menlo, Consolas, 'DejaVu Sans Mono', monospace;
  padding: 4px;
  vertical-align: top;
  -webkit-user-select: text;
  white-space: nowrap;
}
.nuclide-vcs-log-summary-cell {
  font-family: Menlo, Consolas, 'DejaVu Sans Mono', monospace;
  padding: 4px;
  vertical-align: top;
  -webkit-user-select: text;
  color: #d9dbde;
}
.nuclide-vcs-log-show-diff-cell {
  textAlign: center;
  padding: 0px 8px;
}
.nuclide-vcs-log-show-diff-cell .right-align {
  float: right;
}
.nuclide-vcs-log-diff-container {
  display: flex;
}
.nuclide-vcs-log-editor-loading-indicator {
  align-items: center;
  display: flex;
  justify-content: center;
  position: absolute;
  top: 0;
  width: 100%;
}
.nuclide-vcs-log-editor-loading {
  pointer-events: none;
  opacity: 0.5;
}
.nuclide-vcs-log-editor {
  width: 50%;
}
